//-------------------------------------------------------------------------
// Callback on PushBActivate of _PushButtonL03
//-------------------------------------------------------------------------
void BITCreateAssemSndDlg::OnPushButtonL03PushBActivateNotification(CATCommand* cmd, CATNotification* evt, CATCommandClientData data)
{
  int LineSelected = _ComboXS -> GetSelect();
//悬臂梁集中载荷
  if(LineSelected == 0)
  {
	  double CAUb,CAUl,CAUP,CAUE,CAUI,CAUx ;
	  CAUb = _EditorWZ ->GetValue();
	  CAUl = _EditorCD ->GetValue();
	  CAUP = _EditorJZ ->GetValue();
	  CAUE = _EditorL04 ->GetValue();
	  CAUI = _EditorL05 ->GetValue();

	  _EditorZA -> SetValue(0,1);
	  _EditorZB -> SetValue(CAUP,1);
//计算挠度值
	  CAUx = (((CAUP*CAUb*CAUb*CAUl)/(2*CAUE*CAUI))*(3-CAUb/CAUl))/1000;
	  _EditorND -> SetValue(CAUx,1);
		

  }
//悬臂梁分布载荷
  if(LineSelected == 1)
  {
	  double CAUl,CAUq,CAUE,CAUI,CAUx ;
	  CAUl = _EditorCD ->GetValue();
	  CAUq = _EditorFB ->GetValue();
	  CAUE = _EditorL04 ->GetValue();
	  CAUI = _EditorL05 ->GetValue();

	  _EditorZA -> SetValue(0,1);
	  _EditorZB -> SetValue(CAUq*CAUl,1);
//计算挠度值
	  CAUx = ((CAUq*CAUl*CAUl*CAUl*CAUl)/(8*CAUE*CAUI))/1000;
	  _EditorND -> SetValue(CAUx,1);	
  }
//简支梁集中载荷
  if(LineSelected == 2)
  {
	  double CAUl,CAUP,CAUE,CAUI,CAUx ;
	  CAUl = _EditorCD ->GetValue();
	  CAUP = _EditorJZ ->GetValue();
	  CAUE = _EditorL04 ->GetValue();
	  CAUI = _EditorL05 ->GetValue();

	  _EditorZA -> SetValue(CAUP/2,1);
	  _EditorZB -> SetValue(CAUP/2,1);
//计算挠度值
	  CAUx = ((CAUP*CAUl*CAUl*CAUl)/(48*CAUE*CAUI))/1000;
	  _EditorND -> SetValue(CAUx,1);
		

  }
  if(LineSelected == 3)
  {
	  double CAUl,CAUq,CAUE,CAUI,CAUx ;
	  CAUl = _EditorCD ->GetValue();
	  CAUq = _EditorFB ->GetValue();
	  CAUE = _EditorL04 ->GetValue();
	  CAUI = _EditorL05 ->GetValue();

	  _EditorZA -> SetValue(CAUq*CAUl/2,1);
	  _EditorZB -> SetValue(CAUq*CAUl/2,1);
//计算挠度值
	  CAUx = ((5*CAUq*CAUl*CAUl*CAUl*CAUl)/(384*CAUE*CAUI))/1000;
	  _EditorND -> SetValue(CAUx,1);	
  }
}


