void BITCreateAssemSndDlg::OnPushButtonJHPushBActivateNotification(CATCommand* cmd, CATNotification* evt, CATCommandClientData data)
{
  CATULong ButtonStateA = _RadioButton102 -> GetState();
  CATULong ButtonStateB = _RadioButton103 -> GetState();
  if(ButtonStateA == CATDlgCheck )
  {
	double NegOne = -1;
	_Editor105 -> SetValue(130.73,1);
	double ReaFor = _EditorZA ->GetValue();
	double Fv = ReaFor/0.6;
	double ReaStress = (Fv/(acos(NegOne)*0.014*0.014))/1000000;
    _Editor107 -> SetValue(ReaStress,1);
	_Editor110 -> SetValue(65.37,1);
	_Editor111 -> SetValue(ReaStress/2,1);
  }
  if(ButtonStateB == CATDlgCheck )
  {
	  double NegOne = -1;
	  _Editor105 -> SetValue(130.73,1);
	  double ReaFor = _EditorZB ->GetValue();
	  double Fv = ReaFor/0.6;
	  double ReaStress = (Fv/(acos(NegOne)*0.014*0.014))/1000000;
		  _Editor107 -> SetValue(ReaStress,1);
	  _Editor110 -> SetValue(65.37,1);
	  _Editor111 -> SetValue(ReaStress/2,1);
  }
}

